import NavBar from "../components/LandingPage/NavBar";
import Banner from "../components/LandingPage/Banner/Banner";
import QuienesSomos from "../components/LandingPage/QuienesSomos/QuienesSomos";
import Servicios from "../components/LandingPage/Servicios/Servicios";
import Contacto from '../components/LandingPage/Contacto/Contacto'
import Footer from "../components/LandingPage/Footer/Footer";
import Link from 'next/link'
  function Index() {

    const { data, loading, error } = useQuery(OBTENER_CLIENTES_USUARIO);
    console.log(data);
    console.log(loading);
    console.log(error);
    if(loading) return 'Cargando....';
    if(data.obtenerClientesVendedor === null) {
      return(
        <button>
          <Link href="/login">
            <a>Login</a>
          </Link>
        </button>
      ) 
    }
    return(
      <>
          <NavBar/>
          <Banner/>
          <QuienesSomos/>
          <Servicios/>
          <Contacto/>
          <Footer/>
      </>
    )
  } 



export default Index
